package gorilla;

public class SequenceParser {

	public SequenceParser(String string) {
		// TODO Auto-generated constructor stub
	}

	public char[] parseI() {
		char wordI[] = new char[5];
		wordI[0] = '*';
		wordI[1] = 'n';
		wordI[2] = 'a';
		wordI[3] = 'm';
		wordI[4] = 'e';
		return wordI;
	}

	public char[] parseJ() {
		char wordJ[] = new char[5];
		wordJ[0] = '*';
		wordJ[1] = 'm';
		wordJ[2] = 'e';
		wordJ[3] = 'a';
		wordJ[4] = 'n';
		return wordJ;
	}

}
